CREATE TABLE `test_run_model_result` ( `test_run_id` bigint(20) NOT NULL, `model_json` longtext NOT NULL, `test_run_model_result_id` bigint(20) NOT NULL AUTO_INCREMENT, PRIMARY KEY (`test_run_model_result_id`))
CREATE TABLE `test_run_host` ( `test_run_host_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `ip` varchar(50) NOT NULL, `host_name` varchar(100) NOT NULL, `num_cpus` int(11) NOT NULL, `memory_bytes` bigint(20) NOT NULL, PRIMARY KEY (`test_run_host_id`), UNIQUE KEY `test_run_host_id_UNIQUE` (`test_run_host_id`))
CREATE TABLE `test_run_jvm` ( `test_run_jvm_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `ip` varchar(50) NOT NULL, `port` int(11) NOT NULL, `heap_bytes` bigint(20) NOT NULL, `java_launch_command` varchar(1000) NOT NULL COMMENT 'The full java command used to start h2o.\n', `java_dash_version` varchar(1000) NOT NULL COMMENT 'Full output of java -version.', `java_version` varchar(50) NOT NULL COMMENT 'e.g. 1.6.0_65\n', PRIMARY KEY (`test_run_jvm_id`), UNIQUE KEY `test_run_jvm_id_UNIQUE` (`test_run_jvm_id`))
CREATE TABLE `test_run_multinomial_classification_result` ( `test_run_multinomial_classification_result_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `level` varchar(100) NOT NULL DEFAULT '', `level_actual_count` bigint(20) NOT NULL DEFAULT '-1', `level_predicted_correctly_count` bigint(20) NOT NULL DEFAULT '-1', `level_error_rate` double NOT NULL DEFAULT '-1', PRIMARY KEY (`test_run_multinomial_classification_result_id`), UNIQUE KEY `test_run_multinomial_classification_result_id_UNIQUE` (`test_run_multinomial_classification_result_id`))
CREATE TABLE `test_run_binomial_classification_result` ( `test_run_id` bigint(20) NOT NULL, `auc` double NOT NULL DEFAULT '-1', `preccision` double NOT NULL DEFAULT '-1', `recall` double NOT NULL DEFAULT '-1', `error_rate` double NOT NULL DEFAULT '-1', `minority_error_rate` double NOT NULL DEFAULT '-1', PRIMARY KEY (`test_run_id`), UNIQUE KEY `test_run_id_UNIQUE` (`test_run_id`))
SELECT * FROM stats WHERE test_name ='" . $test . "' AND node_ip = '" . $ip . "' AND from_unixtime(ts, '%Y%m%d') = '" . $dt . "' AND test_run_id IN (SELECT MAX(test_run_id) FROM stats WHERE test_name ='" . $test . "' AND node_ip = '" . $ip . "' AND from_unixtime(ts, '%Y%m%d') = '" . $dt . "');
CREATE TABLE `test_run_parameter` ( `test_run_parameter_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `name` varchar(100) NOT NULL, `value` text NOT NULL, PRIMARY KEY (`test_run_parameter_id`), UNIQUE KEY `test_run_parameter_id_UNIQUE` (`test_run_parameter_id`))
CREATE TABLE `test_run_clustering_result` ( `test_run_clustering_result_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `k` int(11) NOT NULL DEFAULT '-1' COMMENT 'Number of centers.', `withinss` double NOT NULL DEFAULT '-1', PRIMARY KEY (`test_run_clustering_result_id`), UNIQUE KEY `test_run_clustering_result_id_UNIQUE` (`test_run_clustering_result_id`))
CREATE TABLE `test_run_phase_result` ( `test_run_phase_result_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `phase_name` varchar(50) NOT NULL, `start_epoch_ms` bigint(20) NOT NULL, `end_epoch_ms` bigint(20) NOT NULL, `stdouterr` longtext, `passed` tinyint(1) NOT NULL DEFAULT '0', `correctness_passed` tinyint(1) NOT NULL DEFAULT '0', `timing_passed` tinyint(1) NOT NULL DEFAULT '0', `contaminated` tinyint(1) NOT NULL DEFAULT '0', `contamination_message` longtext, PRIMARY KEY (`test_run_phase_result_id`), UNIQUE KEY `test_run_phase_result_id_UNIQUE` (`test_run_phase_result_id`))
CREATE TABLE `test_run_regression_result` ( `test_run_regression_result_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(20) NOT NULL, `aic` double NOT NULL DEFAULT '-1', `null_deviance` double NOT NULL DEFAULT '-1', `residual_deviance` double NOT NULL DEFAULT '-1', PRIMARY KEY (`test_run_regression_result_id`), UNIQUE KEY `test_run_regression_result_id_UNIQUE` (`test_run_regression_result_id`))
CREATE TABLE `python_message` ( `python_message_id` bigint(20) NOT NULL AUTO_INCREMENT, `test_run_id` bigint(2) NOT NULL, `message` longtext NOT NULL, `row` longtext NOT NULL, PRIMARY KEY (`python_message_id`), UNIQUE KEY `python_message_id_UNIQUE` (`python_message_id`))
